import React from 'react';

import Home from './routes/Home';
import Contact from './routes/Contact';


import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";

function App() {
  return (
    <>
      <Router>
        <Switch>
          <Route exact path= "/">
            <Home />
          </Route>
          <Route exact path='/contact'>
            <Contact/>   
          </Route>
        </Switch>
      </Router>

     {/* <p><Navbar /></p>
      <Hero />
      <Analytics />
      <Outlet />
      <Newsletter />
      <Cards />
  <Footer />*/}
    </>

  );
}

export default App;
